import React from 'react';

const Beer = (props) => {
  console.log(props.beer);
  const {
    image_url,
    name,
    tagline,
    first_brewed,
    attenuation_level,
    description,
    contributed_by,
  } = props.beer;
  return (
    <div>
      <img src={image_url} alt="beer"></img>
    </div>
  );
};

export default Beer;
